import React, { useState, useEffect } from "react";
import { Container, Row, Col } from "react-bootstrap";
import PackageInfo from "./PackageInfo";

const ReadTours2 = () => {
  const [items, setItems] = useState([]);

  // Dummy data for testing frontend
  const dummyData = [
    {
      _id: "1",
      packageName: "Albanian Adventure",
      packageDescription: "Explore the mountains and beaches of Albania.",
      packageDestination: "Tirana, Shkoder",
      packageDays: 5,
      packageTransportation: "private car",
      packagePrice: 600,
      packageRegion: "Albania",
      packageImage: "albania.jpg",
    },
    {
      _id: "2",
      packageName: "European Highlights",
      packageDescription: "Visit Paris, Rome, and Berlin in one trip.",
      packageDestination: "Paris, Rome, Berlin",
      packageDays: 10,
      packageTransportation: "airplane",
      packagePrice: 2500,
      packageRegion: "Europe",
      packageImage: "europe.jpg",
    },
    {
      _id: "3",
      packageName: "Middle East Explorer",
      packageDescription: "Discover ancient history and desert adventures.",
      packageDestination: "Dubai, Petra",
      packageDays: 7,
      packageTransportation: "train",
      packagePrice: 1500,
      packageRegion: "Middle East",
      packageImage: "middleeast.jpg",
    },
    {
      _id: "4",
      packageName: "Far East Journey",
      packageDescription: "Experience vibrant cultures and landscapes.",
      packageDestination: "Tokyo, Beijing, Seoul",
      packageDays: 12,
      packageTransportation: "airplane",
      packagePrice: 3000,
      packageRegion: "Far East",
      packageImage: "fareast.jpg",
    },
  ];

  useEffect(() => {
    // Directly set dummy data for testing
    setItems(dummyData);
  }, []);

  return (
    <Container>
      <h2 className="mb-4">Test Tours</h2>

      <Row align-items-center>
        {items.map((item) => (
          <Col md={6} className="mb-5" key={item._id}>
            <PackageInfo {...item} />
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default ReadTours2;
